h multiple AuditConfigs: { \"audit_configs\": [ { \"service\": \"allServices\", \"audit_log_configs\": [ { \"log_type\": \"DATA_READ\", \"exempted_members\": [ \"user:jose@example.com\" ] }, { \"log_type\": \"DATA_WRITE\" }, { \"log_type\": \"ADMIN_READ\" } ] }, { \"service\": \"sampleservice.googleapis.com\", \"audit_log_configs\": [ { \"log_type\": \"DATA_READ\" }, { \"log_type\": \"DATA_WRITE\", \"exempted_members\": [ \"user:aliya@example.com\" ] } ] } ] } For sampleservice, this policy enables DATA_READ, DATA_WRITE and ADMIN_READ logging. It also exempts `jose@example.com` from DATA_READ logging, and `aliya@example.com` from DATA_WRITE logging." }, "TargetsPresentCondition": { "properties": { "missingTargets": { "items": { "type": "string" }, "description": "The list of Target names that are missing. For example, projects/{project_id}/locations/{location_name}/targets/{target_name}.", "type": "array" }, "status": { "type": "boolean", "description": "True if there aren't any missing Targets." }, "updateTime": { "type": "string", "description": "Last time the condition was updated.", "format": "google-datetime" } }, "type": "object", "id": "TargetsPresentCondition", "description": "TargetsPresentCondition contains information on any Targets defined in the Delivery Pipeline that do not actually exist." }, "PipelineReadyCondition": { "id": "PipelineReadyCondition", "properties": { "status": { "description": "True if the Pipeline is in a valid state. Otherwise at least one condition in `PipelineCondition` is in an invalid state. Iterate over those conditions and see which condition(s) has status = false to find out what is wrong with the Pipeline.", "type": "boolean" }, "updateTime": { "description": "Last time the condition was updated.", "format": "google-datetime", "type": "string" } }, "type": "object", "description": "PipelineReadyCondition contains information around the status of the Pipeline." }, "BuildArtifact": { "type": "object", "properties": { "tag": { "description": "Image tag to use. This will generally be the full path to an image, such as \"gcr.io/my-project/busybox:1.2.3\" or \"gcr.io/my-project/busybox@sha256:abc123\".", "type": "string" }, "image": { "description": "Image name in Skaffold configuration.", "type": "string" } }, "id": "BuildArtifact", "description": "Description of an a image to use during Skaffold rendering." }, "TargetNotificationEvent": { "id": "TargetNotificationEvent", "type": "object", "properties": { "target": { "type": "string", "description": "The name of the `Target`." }, "type": { "enum": [ "TYPE_UNSPECIFIED", "TYPE_PUBSUB_NOTIFICATION_FAILURE", "TYPE_RENDER_STATUES_CHANGE" ], "description": "Type of this notification, e.g. for a Pub/Sub failure.", "type": "string", "enumDescriptions": [ "Type is unspecified.", "A Pub/Sub notification failed to be sent.", "Release render status changed notification." ] }, "message": { "type": "string", "description": "Debug message for when a notification fails to send." } }, "description": "Payload proto for \"clouddeploy.googleapis.com/target_notification\" Platform Log event that describes the failure to send target status change Pub/Sub notification." }, "PipelineCondition": { "properties": { "pipelineReadyCondition": { "$ref": "PipelineReadyCondition", "description": "Details around the Pipeline's overall status." }, "targetsPresentCondition": { "$ref": "TargetsPresentCondition", "description": "Detalis around targets enumerated in the pipeline." } }, "description": "PipelineCondition contains all conditions relevant to a Delivery Pipeline.", "type": "object", "id": "PipelineCondition" }, "TestIamPermissionsResponse": { "description": "Response message for `TestIamPermissions` method.", "type": "object", "id": "TestIamPermissionsResponse", "properties": { "permissions": { "items": { "type": "string" }, "description": "A subset of `TestPermissionsRequest.permissions` that the caller is allowed.", "type": "array" } } }, "ApproveRolloutResponse": { "type": "object", "properties": {}, "description": "The response object from `ApproveRollout`.", "id": "ApproveRolloutResponse" }, "Status": { "type": "object", "id": "Status", "description": "The `Status` type defines a logical error model that is suitable for different programming environments, including REST APIs and RPC APIs. It is used by [gRPC](https://github.com/grpc). Each `Status` message contains three pieces of data: error code, error message, and error details. You can find out more about this error model and how to work with it in the [API Design Guide](https://cloud.google.com/apis/design/errors).", "properties": { "message": { "type": "string", "description": "A developer-facing error message, which should be in English. Any user-facing error message should be localized and sent in the google.rpc.Status.details field, or localized by the client." }, "code": { "type": "integer", "format": "int32", "description": "The status code, which should be an enum value of google.rpc.Code." }, "details": { "type": "array", "description": "A list of messages that carry the error details. There is a common set of message types for APIs to use.", "items": { "type": "object", "additionalProperties": { "description": "Properties of the object. Contains field @type with type URL.", "type": "any" } } } } }, "TestIamPermissionsRequest": { "type": "object", "id": "TestIamPermissionsRequest", "properties": { "permissions": { "description": "The set of permissions to check for the `resource`. Permissions with wildcards (such as `*` or `storage.*`) are not allowed. For more information see [IAM Overview](https://cloud.google.com/iam/docs/overview#permissions).", "items": { "type": "string" }, "type": "array" } }, "description": "Request message for `TestIamPermissions` method." }, "SkaffoldVersion": { "id": "SkaffoldVersion", "type": "object", "description": "Details of a supported Skaffold version.", "properties": { "supportEndDate": { "$ref": "Date", "description": "Date when this version is expected to no longer be supported." }, "version": { "type": "string", "description": "Release version number. For example, \"1.20.3\"." } } }, "GkeCluster": { "type": "object", "description": "Information specifying a GKE Cluster.", "properties": { "internalIp": { "type": "boolean", "description": "Optional. If true, `cluster` is accessed using the private IP address of the control plane endpoint. Otherwise, the default IP address of the control plane endpoint is used. The default IP address is the private IP address for clusters with private control-plane endpoints and the public IP address otherwise. Only specify this option when `cluster` is a [private GKE cluster](https://cloud.google.com/kubernetes-engine/docs/concepts/private-cluster-concept)." }, "cluster": { "description": "Information specifying a GKE Cluster. Format is `projects/{project_id}/locations/{location_id}/clusters/{cluster_id}.", "type": "string" } }, "id": "GkeCluster" }, "SetIamPolicyRequest": { "type": "object", "description": "Request message for `SetIamPolicy` method.", "properties": { "updateMask": { "type": "string", "format": "google-fieldmask", "description": "OPTIONAL: A FieldMask specifying which fields of the policy to modify. Only the fields in the mask will be modified. If no mask is provided, the following default mask is used: `paths: \"bindings, etag\"`" }, "policy": { "$ref": "Policy", "description": "REQUIRED: The complete policy to be applied to the `resource`. The size of the policy is limited to a few 10s of KB. An empty policy is a valid policy but certain Google Cloud services (such as Projects) might reject them." } }, "id": "SetIamPolicyRequest" }, "SerialPipeline": { "id": "SerialPipeline", "properties": { "stages": { "description": "Each stage specifies configuration for a `Target`. The ordering of this list defines the promotion flow.", "items": { "$ref": "Stage" }, "type": "array" } }, "description": "SerialPipeline defines a sequential set of